import "../components/freefire.css";
const cardData = [
    {className:"freefire-card-1",imageUrl:'../Images/cart.png'},
    {className:"freefire-card-2",imageUrl:'../Images/cart.png'},
    {className:"freefire-card-3",imageUrl:'../Images/cart.png'},
    {className:"freefire-card-4",imageUrl:'../Images/apple-card.jpg'}

];

export function Freefire() {
  return (
    <>
      <div className="card-container">
        {cardData.map((cardClass, index) => (
          <div key={index} className={cardClass}>
            <img src={cardClass.imageUrl} alt="" />

          </div>
        ))}
      </div>
    </>
  );
}
